export default {
  name: "Dashboard_component",
  mounted() {
    // Mueve el contenido de las etiquetas <script> aqu√≠
    const navbarStyle = window.config.config.phoenixNavbarStyle;
    if (navbarStyle && navbarStyle !== "transparent") {
      document.querySelector("body").classList.add(`navbar-${navbarStyle}`);
    }
    const navbarTopStyle = window.config.config.phoenixNavbarTopStyle;
    const navbarTop = document.querySelector(".navbar-top");
    if (navbarTopStyle === "darker") {
      navbarTop.classList.add("navbar-darker");
    }
    const navbarVerticalStyle = window.config.config.phoenixNavbarVerticalStyle;
    const navbarVertical = document.querySelector(".navbar-vertical");
    if (navbarVertical && navbarVerticalStyle === "darker") {
      navbarVertical.classList.add("navbar-darker");
    }
  }
};
